import React from 'react';
import servicesData from '../data/services'

// boilerplate for each service offered
function Services(props) {
  return (
    <div id="service">
      {/* <div id="service-img">
        <img src={props.img}/>
      </div> */}
      <div id="service-text">
          <h3>{props.title}</h3>
          {/* <p>{props.description}</p> */}
          {/* <button>{props.btnText}</button> */}
      </div>
    </div>
  );
}

function Home() {
  return (
    <div>
    {/* <div>
      <h1>Pro Ride Coaching</h1>
      <img className="bike" src="https://cdn.shopify.com/s/files/1/1772/1703/t/16/assets/cowboy-3-absolute-black-mudguards_1200x.png?v=2856224820422431643" alt="bike" />
    </div> */}
      <div className="services-container">
          {servicesData.map((service, key) => (
          <Services key={key} img={service.img} title={service.title} description={service.description} btnText={service.btnText} />
          ))}
      </div>

      <div id="carouselExampleIndicators" class="carousel slide" data-ride="carousel">
        <ol class="carousel-indicators">
          <li data-target="#carouselExampleIndicators" data-slide-to="0" class="active"></li>
          <li data-target="#carouselExampleIndicators" data-slide-to="1"></li>
          <li data-target="#carouselExampleIndicators" data-slide-to="2"></li>
        </ol>
        <div class="carousel-inner">
          <div class="carousel-item active">
            <img class="d-block w-100" src="..." alt="First slide" />
          </div>
          <div class="carousel-item">
            <img class="d-block w-100" src="..." alt="Second slide" />
          </div>
          <div class="carousel-item">
            <img class="d-block w-100" src="..." alt="Third slide" />
          </div>
        </div>
        <a class="carousel-control-prev" href="#carouselExampleIndicators" role="button" data-slide="prev">
          <span class="carousel-control-prev-icon" aria-hidden="true"></span>
          <span class="sr-only">Previous</span>
        </a>
        <a class="carousel-control-next" href="#carouselExampleIndicators" role="button" data-slide="next">
          <span class="carousel-control-next-icon" aria-hidden="true"></span>
          <span class="sr-only">Next</span>
        </a>
      </div>

    </div>
  );
}

export default Home;
